  null,\n\t\"notes\": \"Dozens of definitions are currently used by Federal and State
  agencies, researchers, and policymakers. The ERS Rural Definitions data product
  allows users to make comparisons among nine representative rural definitions. rnrnMethods
  of designating the urban periphery range from the use of municipal boundaries to
  definitions based on counties. Definitions based on municipal boundaries may classify
  as rural much of what would typically be considered suburban. Definitions that delineate
  the urban periphery based on counties may include extensive segments of a county
  that many would consider rural.rnrnWe have selected a representative set of nine
  alternative rural definitions and compare social and economic indicators from the
  2000 decennial census across the nine definitions. We chose socioeconomic indicators
  (population, education, poverty, etc.) that are commonly used to highlight differences
  between urban and rural areas.\",\n\t\"owner_org\": \"4ae51f6c-467a-4f9d-b40a-2c52e83c326a\",\n\t\"extras\":
